import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from "./comps/Homepage";

const RouteSwitch = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<HomePage />} />
        {/* <Route path="/profile" element={<Profile />} /> */}
      </Routes>
    </BrowserRouter>
  );
};

export default RouteSwitch;
